import { Morph, VerticalLayout, show, CenteredTilingLayout } from "lively.morphic";
import { resource } from "lively.resources/index.js";
import { connect, noUpdate, disconnect, disconnectAll } from "lively.bindings/index.js";
import { pt, rect, Rectangle, Color } from "lively.graphics/index.js";
import LoadingIndicator from "lively.morphic/components/loading-indicator.js";
import { promise, arr } from "lively.lang/index.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";
import { MorphicDB } from "lively.morphic/morphicdb/index.js";
import { partition } from "lively.lang/array.js";

export default class WorldList2 extends Morph {

  static get properties() {

    return {

      epiMorph: {defaultValue: true},

      ui: {
        derived: true, readOnly: true, after: ["submorphs"],
        get() {
          return {
            label: this.getSubmorphNamed("world-list-label"),
            cancelButton: this.getSubmorphNamed("cancelButton"),
            worldList: this.getSubmorphNamed("worldList"),
            sortSelector: this.getSubmorphNamed("sort selector"),
            filterSelector: this.getSubmorphNamed("filter selector"),
          }
        }
      },

      sort: {
        values: ["lexically", "lastmodified"],
        defaultValue: "lexically",
      },

      filter: {
        values: ["all", "user"],
        defaultValue: "all",
      },

      previews: {
        after: ["worldList"],
        defaultValue: [],
        set(newPreviews) {
          let previews = this.getProperty("previews") || [];
          let [keep, remove] = partition(previews, ea => newPreviews.includes(ea));
          remove.forEach(ea => ea.remove());
          this.setProperty("previews", newPreviews);
        }
      }
    }

  }

  relayout() {
    let bounds = this.innerBounds(),
        {
          label,
          cancelButton,
          worldList,
          sortSelector, filterSelector
        } = this.ui;

    label.topCenter = bounds.topCenter().addXY(0, 5)
    cancelButton.bottomCenter = bounds.bottomCenter().addXY(0, -5);

    sortSelector.rightCenter = pt(bounds.width-10, cancelButton.center.y);
    filterSelector.rightCenter = sortSelector.leftCenter.addXY(-10, 0);

    if (filterSelector.left < cancelButton.right) {
      filterSelector.left = cancelButton.right;
      if (sortSelector.left < filterSelector.right)
        sortSelector.left = filterSelector.right;
    }

    // sortSelector.topRight = pt(bounds.width/2-10, label.bottom+10)
    // filterSelector.topLeft = pt(bounds.width/2+10, label.bottom+10)

    // worldList.setBounds(rect(pt(0, filterSelector.bottom+5),
    //                          pt(bounds.width, cancelButton.top-5)));
    worldList.setBounds(rect(pt(0, label.bottom+5),
                             pt(bounds.width, cancelButton.top-5)));

  }

  alignInWorld(world = this.world()) {
    world.addMorph(this);
    let {width, height} = world.visibleBounds();
    this.width = (width*1/2) - 5;
    this.height = (height*1/2) - 10
    this.center = world.visibleBounds().center();
    return this;
  }

  reset() {
    // this.reset();
    // this.location = "public";
    // this.update();

    // this.previews = [];
    // connect(this, 'extent', this, 'relayout');

    this.clipMode = "hidden";

    let {ui: {label, worldList, cancelButton, sortSelector, filterSelector}} = this;

    sortSelector.items = [{
      isListItem: true,
      string: "sort: last modification",
      value: "lastmodified"
    }, {
      isListItem: true,
      string: "sort: alphabetically",
      value: "lexically"
    }]
    sortSelector.selection = this.sort = "lexically"
    connect(sortSelector, 'selection', this, 'sort');
    connect(sortSelector, 'selection', this, 'applyFilter');

    filterSelector.items = [{
      isListItem: true,
      string: "filter: show all",
      value: "all"
    }, {
      isListItem: true,
      string: "filter: show mine",
      value: "user"
    }];
    filterSelector.selection = this.sort = "all"
    connect(filterSelector, 'selection', this, 'filter');
    connect(filterSelector, 'selection', this, 'applyFilter');

    label.fontColor = Color.white
    label.fontSize = 26;
    label.value = "Select a world to load";
    label.fit()


    worldList.layout = new CenteredTilingLayout({spacing: 15, border:{top: 10, bottom: 10}});
    worldList.clipMode = "auto";
    worldList.fill = Color.rgbHex("777").withA(.7);
    worldList.draggable = false;

    cancelButton.label = "close"
    cancelButton.activeStyle = {
      borderWidth: 2,
      fill: Color.transparent,
      borderColor: Color.red.lighter(),
      fontColor: Color.red.lighter(),
      fontStyle: "bold",
      nativeCursor: "pointer"
    }

    connect(cancelButton, 'fire', this, 'remove');
  }

  beforePublish() {
    // disconnectAll(this);
    this.reset();
  }

  get db() { return MorphicDB.default; }

  async update() {
    // await this.update()

    // this.ui.worldList.layout = new CenteredTilingLayout({resizeSubmorphs: false, autoResize: false, spacing: 8})
    // this.ui.worldList.layout = new VerticalLayout({resizeSubmorphs: true, autoResize: false, spacing: 15})
    this.previews = [];

    let i = LoadingIndicator.open("fetching worlds..."),
        previews = [],
        wl = this.ui.worldList,
        commits = await this.db.latestCommits("world"),
        previewProto = await loadObjectFromPartsbinFolder("world preview"),
        w = Math.max(280, Math.min(400, (wl.width-40)/2)),
        loading = commits.map(commit => {
          let preview = new previewProto.constructor({extent: pt(w, 100)});
          let prom = preview.initWithCommit(commit);
          preview.setButtonVisibility(false);
          previews.push(preview)
          return prom
        });

    this.previews = previews;
    this.applyFilter();
    await Promise.all(loading);
    i.remove()
    return this;
  }

  sortPreviews(previews) {
    let {sort} = this;
    sort = sort || "lexically";
    return arr.sortBy(previews, p => {
      let {name, timestamp} = p.state.commit;
      if (sort === "lexically") return name.toLowerCase();
      return timestamp;
    });
  }

  applyFilter() {
    let {previews} = this;
    let visible = [];
    let user = $world.getCurrentUser().name;
    let filterFn = this.filter === "user" ?
                    commit => commit.author.name === user :
                    () => true;
    for (let p of previews) {
      if (filterFn(p.state.commit)) visible.push(p);
      else p.remove();
    }
    let sorted = this.sortPreviews(visible)
    sorted.forEach((ea, i) => ea.position = pt(i,i));
    this.ui.worldList.submorphs = sorted;
  }

  worldNameOfPreview(previewMorph) {
    return previewMorph.submorphs[1].textString;
  }

  previewFor(name) {
    return this.previews.find(ea =>
      ea.submorphs[1].textString === name);
  }

  async onWorldSaved(name) {
    let i = LoadingIndicator.open("updating...");
    //     r = await this.resourceFor(name);
    // await this.addPreviewMorph(r);
    i.remove();
  }

  async onWorldRemoved({type, name}) {}


}
